script: |
  super -f text -I q11363.spq | sort > q11363.out

inputs:
  - name: q11363.spq
    data: |
      SELECT - + col0 FROM tab1 (FORMAT parquet) WHERE NOT ( - 58 * + col0 / - 57 * - col2 - 68 + col1 ) > col2;
  - name: tab1

outputs:
  - name: q11363.out
    data: |
      -51
      -85
      -91
